vec2 power(in vec2 xy,in int powof){
    vec2 z;
    for (int x=0; x<powof; x++){
        z = xy *xy;
    }
    return z;
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{

    vec2 uv = fragCoord/iResolution.xy -0.5;

    vec3 col = vec3(length(2.*power(uv.xy,3)+50.*power(uv.xy,2) + power(uv.xy,2)+0.5));
    col*= fract(2.*cos(length(col/0.2)+vec3(9,21,20)+iTime))-0.6;
    fragColor = vec4(col,1.0);
}
